import Shell from "./Shell";
import TextField from "@mui/material/TextField";
import { Typography, Container, CardContent, useTheme } from "@mui/material";

function Contact() {
  const properties = {
    nameContainer: {
      component: "div",
      id: "name",
    },
    email: {
      id: "email",
      type: "email",
      label: <Typography>Email</Typography>,
    },
    firstName: {
      id: "first name",
      type: "text",
      label: <Typography>first</Typography>,
    },
    lastName: {
      id: "last name",
      type: "text",
      label: <Typography>last</Typography>,
    },
  };

  const theme = useTheme();

  const styles = (theme) => ({
    cardContent: {
      backgroundColor: "blue",
    },
  });

  return (
    <Shell
      heading="Contact Information"
      //   subheading="Click the button below to get started"
      content={
        <CardContent sx={styles(theme).cardContent}>
          <Container {...properties.nameContainer} sx={{}}>
            <TextField {...properties.firstName} sx={{ mx: 5 }} />
            <TextField {...properties.lastName} sx={{ mx: 5 }} />
          </Container>
          <TextField {...properties.email} />
        </CardContent>
      }
    />
  );
}

export default Contact;
